import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { ThirdwebProvider } from "@thirdweb-dev/react";
import { DAppProvider } from "@usedapp/core";
import App from "./App";
import NdmLandingPage from "./NdmLandingPage"; // Import your NdmLandingPage component
import Nav from "./components/Banner/Stake/St";
import Dav from "./components/Banner/Wheel/st";

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <React.StrictMode>
    <ThirdwebProvider activeChain={"binance"}>
      <DAppProvider config={{}}>
        <Router>
          <Routes>
            <Route path="/" element={<NdmLandingPage />} />
            <Route path="/app" element={<App />} />
            {/* <Route path="/Stake/St" element={<Nav />} /> */}
            {/* <Route path="/Wheel/St" element={<Dav />} /> */}
          </Routes>
        </Router>
      </DAppProvider>
    </ThirdwebProvider>
  </React.StrictMode>
);
